def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    assert isinstance(n, int) and n > 0, f"Input must be a positive integer. Received: {n}."

    def count_starting_with_1(n):
        if n == 1:
            return 1
        return 10 ** (n - 1)

    def count_ending_with_1(n):
        if n == 1:
            return 1
        return 9 * (10 ** (n - 1))

    def count_starting_and_ending_with_1(n):
        if n == 1:
            return 1
        return 10 ** (n - 2)

    total_start_with_1 = count_starting_with_1(n)
    total_end_with_1 = count_ending_with_1(n)
    overlap = count_starting_and_ending_with_1(n)

    # Verify intermediate results
    assert total_start_with_1 >= 0, f"Total numbers starting with 1 should be non-negative. Received: {total_start_with_1}."
    assert total_end_with_1 >= 0, f"Total numbers ending with 1 should be non-negative. Received: {total_end_with_1}."
    assert overlap >= 0, f"Overlap should be non-negative. Received: {overlap}."

    count = total_start_with_1 + total_end_with_1 - overlap
    # Validate output
    assert count >= 0, f"The count of numbers should be non-negative. Received: {count}."
    return count
